import React from "react";
import { motion } from "framer-motion";

const ProjectRacc = () => {
  return (
    <div className="bg-[#141414] text-white font-sans">
      {/* Hero Section */}
      <section className="h-screen flex flex-col justify-center items-center bg-gradient-to-b from-[#141414] to-[#1c1c1c]">
        <motion.h1
          className="text-5xl md:text-6xl font-bold text-white"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 1 }}
        >
          RaccTracc: Enhancing Raccoon Appreciation at UCSD
        </motion.h1>
        <motion.p
          className="text-lg md:text-xl text-gray-300 mt-4 text-center"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.5 }}
        >
          A platform combining real-time tracking, education, and community for raccoon enthusiasts.
        </motion.p>
        <motion.div
          className="mt-10"
          initial={{ scale: 0 }}
          animate={{ scale: 1 }}
          transition={{ delay: 1 }}
        >
          <img
            src="placeholder-hero.png"
            alt="RaccTracc Mockup"
            className="rounded-lg shadow-lg w-3/4 md:w-1/2 hover:scale-105 transition-transform"
          />
        </motion.div>
      </section>

      {/* Project Overview */}
      <motion.section
        className="py-12 px-6 md:px-16"
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        viewport={{ once: true }}
        transition={{ duration: 0.5 }}
      >
        <h2 className="text-4xl font-bold bg-gradient-to-r from-vibrant-blue to-vibrant-green bg-clip-text text-transparent">
          Project Overview
        </h2>
        <p className="text-gray-300 mt-4 leading-relaxed">
          RaccTracc is an innovative platform designed to bring the raccoon-loving community closer by offering interactive features like real-time tracking, educational resources, and collaborative tools. Inspired by the viral @ucsd.raccoons Instagram account, it elevates wildlife appreciation to new heights.
        </p>
      </motion.section>

      {/* Key Features Section */}
      <motion.section
        className="py-12 px-6 md:px-16 bg-gradient-to-b from-primary to-black"
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        viewport={{ once: true }}
        transition={{ duration: 0.5 }}
      >
        <h2 className="text-4xl font-bold text-center bg-gradient-to-r from-vibrant-yellow to-vibrant-green bg-clip-text text-transparent">
          Key Features
        </h2>
        <div className="mt-10 grid grid-cols-1 md:grid-cols-3 gap-8">
          {[
            {
              title: "Live Tracking",
              description: "Get instant updates on raccoon sightings across campus.",
            },
            {
              title: "Educational Resources",
              description: "Access safety tips, behavioral insights, and habitat details.",
            },
            {
              title: "Community Engagement",
              description: "Collaborate with fellow raccoon lovers through shared sightings.",
            },
          ].map((feature, idx) => (
            <motion.div
              key={idx}
              className="p-6 bg-gray-800 rounded-lg shadow-lg hover:shadow-2xl hover:scale-105 transition-transform"
              whileHover={{ scale: 1.1 }}
            >
              <h3 className="text-xl font-bold text-vibrant-yellow">{feature.title}</h3>
              <p className="mt-2 text-gray-400">{feature.description}</p>
            </motion.div>
          ))}
        </div>
      </motion.section>

      {/* Impact Section */}
      <motion.section
        className="py-12 px-6 md:px-16"
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        viewport={{ once: true }}
        transition={{ duration: 0.5 }}
      >
        <h2 className="text-4xl font-bold bg-gradient-to-r from-vibrant-blue to-vibrant-pink bg-clip-text text-transparent">
          Impact
        </h2>
        <p className="text-gray-300 mt-4 leading-relaxed">
          RaccTracc transformed raccoon watching into a meaningful activity, encouraging responsible wildlife interactions and fostering a tight-knit community. The app’s success lies in its ability to combine education, interaction, and passion into one cohesive experience.
        </p>
      </motion.section>

      {/* Call to Action */}
      <section className="text-center py-12 bg-gradient-to-t from-[#141414] to-[#1c1c1c]">
        <a
          href="#"
          className="px-6 py-3 text-lg font-bold text-white bg-vibrant-green rounded-lg shadow-md hover:bg-vibrant-blue transition-colors"
        >
          Explore RaccTracc
        </a>
      </section>
    </div>
  );
};

export default ProjectPage;
